import React from "react";
import "../../Forms/forms.css";
import CartItem from "./CartItem";

export default function Cart(props) {
  const { cartItems, addToCart, removeFromCart } = props;

  return (
    <aside>
      <h6>your items:</h6>
      <div>
        <CartItem
          key={cartItems.id}
          purchases={cartItems}
          addToCart={addToCart}
          removeFromCart={removeFromCart}
        ></CartItem>
      </div>
    </aside>
  );
}
